import React, { useState, useCallback } from 'react';
import { 
    Box, 
    Paper, 
    Typography,
    Button,
    IconButton,
    List,
    ListItem,
    ListItemText,
    ListItemSecondaryAction,
    Divider
} from '@mui/material';
import { styled } from '@mui/material/styles';
import { CloudUpload, Delete, InsertDriveFile } from '@mui/icons-material';

interface FileSelectorProps {
    onFileSelect: (fileNumber: number) => void;
}

const DropZone = styled(Paper)(({ theme }) => ({
    border: `2px dashed ${theme.palette.primary.main}`,
    borderRadius: theme.shape.borderRadius,
    padding: theme.spacing(4),
    textAlign: 'center',
    backgroundColor: theme.palette.background.default,
    cursor: 'pointer',
    transition: 'all 0.3s ease-in-out',
    '&:hover': {
        backgroundColor: theme.palette.action.hover,
        borderColor: theme.palette.primary.dark
    }
}));

const RecentFilesList = styled(List)(({ theme }) => ({
    marginTop: theme.spacing(4),
    backgroundColor: theme.palette.background.paper,
    borderRadius: theme.shape.borderRadius
}));

const FileSelector: React.FC<FileSelectorProps> = ({ onFileSelect }) => {
    const [dragActive, setDragActive] = useState(false);
    const [recentFiles] = useState([
        { id: 1, name: 'Exemple 1', description: 'Graphe simple avec 5 tâches' },
        { id: 2, name: 'Exemple 2', description: 'Graphe complexe avec 10 tâches' },
        { id: 3, name: 'Exemple 3', description: 'Graphe avec circuit' }
    ]);

    const handleDrag = useCallback((e: React.DragEvent) => {
        e.preventDefault();
        e.stopPropagation();
        if (e.type === "dragenter" || e.type === "dragover") {
            setDragActive(true);
        } else if (e.type === "dragleave") {
            setDragActive(false);
        }
    }, []);

    const handleDrop = useCallback((e: React.DragEvent) => {
        e.preventDefault();
        e.stopPropagation();
        setDragActive(false);

        if (e.dataTransfer.files && e.dataTransfer.files[0]) {
            // Ici, nous simulons le chargement du premier exemple
            // Dans une vraie application, nous traiterions le fichier
            onFileSelect(1);
        }
    }, [onFileSelect]);

    const handleFileInput = useCallback((e: React.ChangeEvent<HTMLInputElement>) => {
        e.preventDefault();
        if (e.target.files && e.target.files[0]) {
            // Simuler le chargement du premier exemple
            onFileSelect(1);
        }
    }, [onFileSelect]);

    return (
        <Box>
            <DropZone
                elevation={0}
                onDragEnter={handleDrag}
                onDragLeave={handleDrag}
                onDragOver={handleDrag}
                onDrop={handleDrop}
                sx={{
                    backgroundColor: dragActive ? 'action.hover' : 'background.default'
                }}
            >
                <input
                    type="file"
                    accept=".txt"
                    onChange={handleFileInput}
                    style={{ display: 'none' }}
                    id="file-upload"
                />

                <CloudUpload sx={{ fontSize: 48, color: 'primary.main', mb: 2 }} />

                <Typography variant="h6" gutterBottom>
                    Glissez-déposez votre fichier ici
                </Typography>

                <Typography variant="body2" color="text.secondary" paragraph>
                    ou
                </Typography>

                <label htmlFor="file-upload">
                    <Button
                        variant="contained"
                        component="span"
                        startIcon={<InsertDriveFile />}
                    >
                        Sélectionner un fichier
                    </Button>
                </label>

                <Typography variant="body2" color="text.secondary" sx={{ mt: 2 }}>
                    Formats acceptés : .txt
                </Typography>
            </DropZone>

            <Typography variant="h6" sx={{ mt: 4, mb: 2 }}>
                Exemples récents
            </Typography>

            <RecentFilesList>
                {recentFiles.map((file, index) => (
                    <React.Fragment key={file.id}>
                        {index > 0 && <Divider />}
                        <ListItem button onClick={() => onFileSelect(file.id)}>
                            <InsertDriveFile sx={{ mr: 2, color: 'primary.main' }} />
                            <ListItemText
                                primary={file.name}
                                secondary={file.description}
                                primaryTypographyProps={{
                                    sx: { fontWeight: 500 }
                                }}
                            />
                            <ListItemSecondaryAction>
                                <IconButton edge="end" aria-label="delete">
                                    <Delete />
                                </IconButton>
                            </ListItemSecondaryAction>
                        </ListItem>
                    </React.Fragment>
                ))}
            </RecentFilesList>
        </Box>
    );
};

export default FileSelector;
